import $ from 'jquery';
import React from 'react';
import logo from './logo.svg';
import './App.css';

import { Container } from "semantic-ui-react"


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: []
    };
    this.serverRequest = this.serverRequest.bind(this);
  }

  serverRequest(){
    $.get("http://localhost:5000/api/logs/items", res => {
      this.setState({
        items: [{"id":1,"name":"Coffee","category":"Food","price":260,"date":"2019/10/30"},{"id":2,"name":"Train","category":"Exportation","price":250,"date":"2019/10/30"},{"id":3,"name":"Lunch","category":"Food","price":540,"date":"2019/10/30"},{"id":4,"name":"Drink","category":"Food","price":150,"date":"2019/10/31"}]
      });
    });
  }
  componentDidMount(){
    this.serverRequest();
  }
  render() {
    return (
      <div className="App">
        <div className="ui inverted top fixed menu">
          <div className="ui container">
            <a className="header item">
              {this.state.items[0]}
            </a>
            <a className="active item">Home</a>
            <a className="item">Logs</a>
            <a className="item">Export</a>
         </div>  
       </div>
     </div>  
    )
  }
}

function ItemTable(props) {
  return (
    <div className="ui container">
      <table className="ui table">
        <tr>
          <th>Hay</th>
        </tr>
        {props.items.map(function(item, i) {
          return <Item item={item} />;
        })}
      </table>
    </div>  
  )
}

function Item(props) {
  return (
    <tr>
      <td>{props.item.name}</td>
    </tr>
  )
}

export default App;
